import { useContext,useState,useEffect } from 'react';
import React from 'react';
const AddEx = ({num}) => {
    //Dyamically increase num of excersises using prop from create
    
    const [excersises, setExcerises] = useState([num][4]);
 
    

    return ( 
        <div className='excersises' >
            <h2>Add your Excersises</h2>  
            {Array.from({ length: num }, (_, index) => (
                <div key={index} className='excersise'>
                    <h4>Excersise {index +1}</h4>  

                    <label > Excersise Name</label>
                        <input type="text" 
                        required 
                        value = {excersises[index][0]}
                        onChange={(e) => setExcerises(e.target.value)} />
                        <br />

                    <label>Weight (lb)</label>
                        <input type="number" 
                        required value={ excersises[index][1]}
                        onChange={(e) => setExcerises(e.target.value)}/>
                        <br />

                    <label>Sets</label>
                        <input type="number" 
                        required value={excersises[index][2]}
                        onChange={(e) => setExcerises(e.target.value)}
                        />
                        <br />

                    <label>Reps per Set</label>
                        <input type="number" 
                        required value={ excersises[index][3]}
                        onChange={(e) => setExcerises(e.target.value)}
                        />
                    
                </div>

        ))}

   
        </div>
   
     );
}
 
export default AddEx;
